import logo from "./logo.svg";
import "./App.css";
import FormImport from "./view/FormImport";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  BrowserRouter,
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact>
          <div>
            <img>
              <logo />
            </img>
          </div>
          <FormImport />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
